/* Reset for consistency */
* { margin: 0; padding: 0; box-sizing: border-box; }
body { font-family: 'Arial', sans-serif; font-size: 16px; }

/* Test-specific CSS */
.container {
    width: 400px;
    height: 300px;
    display: table;
    border: 2px solid #333;
    padding: 10px;
    border-spacing: 5px;
}
.caption {
    display: table-caption;
    caption-side: top;
    font-weight: bold;
    padding: 10px;
    background-color: #f0f0f0;
    text-align: center;
}
.header-group {
    display: table-header-group;
}
.body-group {
    display: table-row-group;
}
.row {
    display: table-row;
}
.cell {
    display: table-cell;
    padding: 10px;
    box-sizing: border-box;
    text-align: center;
    font-size: 14px;
    border: 1px solid #ccc;
}
.header-group .cell {
    background-color: #e0e0e0;
    font-weight: bold;
}
.body-group .cell:nth-child(1) { background-color: #ffcccc; }
.body-group .cell:nth-child(2) { background-color: #ccffcc; }
.body-group .cell:nth-child(3) { background-color: #ccccff; }
